import React, { useState, useEffect } from "react";
import { getSingleProduct } from "../services/productService";

const ShowProduct = () => {
  const [product, setProduct] = useState({});

  const id = "66230e93862e1249483e6c43";

  useEffect(() => {
    const getData = async () => {
      try {
        const productData = await getSingleProduct(id);
        setProduct(productData);
      } catch (error) {
        console.log("Error fetching data:", error);
      }
    };

    getData();
  }, []);

  return (
    <div className="p-4">

      {/* PAGE BANNER COMPONENT*/}
      <div className="justify-center text-center p-10 py-20">
        <h2 className='text-4xl font-semibold pb-4'>Product Name</h2>
        <h3>Here Be Thy Slogan.</h3>
      </div>

      {/* PRODUCT SUMMARY COMPONENT */}
      <div>
        <h2>The Best Product in the World</h2>
        <div>
          <div className="grid flex cols-2">
            <p>description</p>
          </div>       
          <div>
          <button>DOWNLOAD</button>
          </div>        
        </div>
      </div>

      {/* FEATURE COMPONENT */}
      <div>
        <h2>Features</h2>
        <div>
          <h3>Feature 1</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 2</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 3</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 4</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 5</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 6</h3>
          <p>feature description</p>
        </div>
      </div>

      {/* REASONS COMPONENT */}
      <div>
        <div>
          <h2>Why Use This Product?</h2>
        </div>
        <div>
          <div>
            <h3>Reason 1</h3>
            <p>reason description</p>
          </div>
          <div>
            <h3>Reason 2</h3>
            <p>reason description</p>
          </div>
          <div>
            <h3>Reason 3</h3>
            <p>reason description</p>
          </div>
          <div>
            <h3>Reason 4</h3>
            <p>reason description</p>
          </div>
        </div>
      </div>

      {/* CALLTOACTION COMPONENT */}
      <div>
        <h2>so what are you waitning for?</h2>
        <p>Click the button below to download experience this awesome product</p>
        <button>DOWNLOAD</button>
      </div>

      {/*  */}
      <div></div>
    </div>
  );
};

export default ShowProduct;
